import axios from "axios";
import { useRef, useState, useEffect} from "react";
import infiniteScroll from 'infinite-scroll';
import './App.css';

export default function App() {
    const [results, setResults] = useState([])
    useEffect(() => {
      axios
        .get('./Foodsource.json?page=2&limit=50')
        .then(res => { 
          setResults(res.data)
        })
        .catch(e => { console.log(e)}) },[]);
        const displayData = results.map(
          (info)=> {
            return(
              <tr>
                <td>{info.resteraunt}</td>
                <td>{info.name}</td>
                <td>{info.people}</td>
                <td>{info.timetag}</td>
              </tr>
            )
          }
        )
        const ref = useRef();
        useEffect(() => {
          const row = document.querySelectorAll(".card")
          const observer = new IntersectionObserver(entries => {
            entries.forEach(entry => {
              entry.target.classList.toggle("show", entry.isIntersecting)
            })
          })
          observer.observe(row[0])
        })





  return (
    <div className="App">
      <div>
      <div class="card" ref={ref}> {displayData.slice(0,100)}</div>
      <div class="card" ref={ref}> {displayData.slice(100,200)}</div>
      <div class="card" ref={ref}> {displayData.slice(200,300)}</div>
      <div class="card" ref={ref}> {displayData.slice(300,400)}</div>
      </div>
    </div>


  );
}
